#!/usr/bin/env python

doc = """KmerGenie report generator

Usage:
    generate-report <prefix> [options]

Options:
    -o <value>   name of the report file (default: [prefix]_report.html)
    --diploid    use the diploid model
"""

import sys, os, glob, subprocess, re, base64

if sys.version_info[0] == 2 and sys.version_info[1] < 5:
    sys.exit("Python >= 2.5 is required")

DIR = os.path.dirname(os.path.realpath(__file__))

version = ""
try: #to get version from makefile
    with open("%s/../makefile") as f:
        for line in f:
            if "SVNREV" in line:
                import re
                match = re.search(r".*=(\d\.\d+)$", line)
                version = "version " +match.group(1)
except:
    pass


html_header = """<html>
<head>
<style type="text/css">
.box{
    border: 4px solid #ccc;
    padding:20px;
    margin:10px 100px 100px 10px;
}
#advhelp{
    display:none;
}
#advhelp:target{
    display:block;
}
</style>
</head>
<body>
<h1>KmerGenie report</h1>
"""

html_success = """
<p><h2>Predicted best k: %d</h2></p>
<p><h4>Predicted assembly size: %d bp</h4></p>
"""


html_footer_genomic_kmers = """
<div class="box">
<p>The above plot should be roughly concave and have a clear global maximum. If not, the predicted best k is likely to be inaccurate.<br><a href="#advhelp">Click here for more details.</a></p>
<div id="advhelp">
<p>This box will guide you towards analyzing the main plot produced by Kmergenie (# genomic k-mers vs k).
<p>The y axis is a number of k-mers, but can also be interpreted as the the estimated genome size (in bp) when repeats are collapsed, i.e. the estimated size of an assembly of this dataset.
Note that, according to the Kmergenie article, this plot should be roughly concave.</p>

<p>Thus, in the ideal case, the above plot should be a smooth curve with a clear global maximum, i.e.:</p>

<img src="data:image/png;base64," style="max-height:250px"><br>
<p>However, in some cases, the plot may be more similar to these, with multiple local maximas or a plateau:</p>
<img src="data:image/png;base64," style="max-height:250px"><br>
<p>These cases reflect that the statistical model in Kmergenie does not always correctly fit the input data for some values of k. Thus, the best k value predicted by Kmergenie may be suboptimal. In your subsequent analyses (e.g. de novo assembly), we recommend that you also try a larger k than the one predicted by Kmergenie, following the indications in green in the above plots. Essentially, when the number of estimated genomic k-mers remains high during a large range of k's, the largest k value in this range is likely to be a better choice.<p>
<p>In other cases, the number of genomic k-mers never drops with high k values. This is an indication of a highly covered dataset:<p>
<img src="data:image/png;base64," style="max-height:220px"><br>
<p>In this case, it is recommended to restart Kmergenie with a higher maximal k value (higher than the default value of 120). An unusually high k value (>100) may produce good results.</p>
<p><a href="#">Hide this box</a></p>
</div>
</div>
"""

html_individual_histograms = """
<h3>Sampled histogram and fit for each value of k</h3>
<p>Colors of the fits: red is the fit of the complete statistical model of the histogram (erronous k-mers + genomic k-mers). When using the diploid model, blue are only the heterozygous k-mers, green are only the homozygous k-mers.</p>"""

html_failure = """
<p>Could not predict a best k value</h3>
"""

html_footer = """
<p>Generated by <a href=\"http://kmergenie.bx.psu.edu/\">KmerGenie</a> %s
</body>
</html>""" % version

def run(command):
    process = subprocess.Popen(command, stdout=subprocess.PIPE, stderr=subprocess.PIPE)
    stdout, stderr = process.communicate()
    rc = process.wait()
    return rc, stdout, stderr

def insert_image(name):
    data = bytes(open(name, 'rb').read())
    data_uri = base64.b64encode(data).decode().replace('\n', '')
    return '<img src="data:image/png;base64,%s">\n' % data_uri
 
def generate_report(prefix, best_k, max_genomic_kmers, output, is_diploid):

    has_png, stderr, stdout = run(["Rscript", "--no-init-file", "-e", "if (capabilities()['png'] == T) quit('no',1)"])
    if not has_png:
        print("R cannot output png files; testing if ghostscript is present.."),
        gs_ok = False 
        try:
            rc, osef, osef = run(["gs","--version"])
            if rc == 0:
                gs_ok = True
        except OSError as e:
            pass
        if not gs_ok:
            print("HTML report not generated (Kmergenie is probably running on a cluster): R cannot create png files, and ghostscript is not installed")
            return
        print("OK, let's try ghostscript.")
        output_format = "pdf"
    else:
        output_format = "png"
 
    if not output:
        output = prefix + "_report.html"

    list_histograms = sorted(glob.glob(prefix+"-k*.histo"))
    png_files = []
    for histfile in list_histograms:    
        hist_full_path = os.path.abspath(histfile)
        rcmd = '''hist.file='%s'; is.diploid=%s; output.format='%s';source('%s/plot_histogram.r', chdir=T);''' % (hist_full_path, is_diploid, output_format, DIR)
        command = ['Rscript',"--no-init-file",'-e',rcmd]
        rc, stdout, stderr = run(command)
        if rc:
            print("cannot generate histogram for file %s stdout: %s ; stderr: %s" % (histfile,stdout, stderr))
            continue
        if os.path.exists(hist_full_path + ".pdf") and output_format == "pdf":
            # convert pdf to png using ghostscript
            run(["gs", "-dBATCH", "-dNOPAUSE", "-sDEVICE=pngalpha", "-sOutputFile=%s" % (hist_full_path + ".png"), "-r144", hist_full_path + ".pdf"])
        if os.path.exists(hist_full_path + ".png"):
            png_files += [hist_full_path + ".png"]

    html = html_header
    
    if best_k != 0:
        results_filename = prefix+".dat"
        command = ["Rscript", "--no-init-file", "%s/plot_genomic_kmers.r" % DIR, results_filename, str(best_k), str(max_genomic_kmers)]
        if output_format == "png":
            command += ["--png"]
        rc, stdout, stderr = run(command)
        if rc:
            print("cannot generate plot of number of genomic kmers. stdout: %s ; stderr: %s" % (stdout, stderr))
        html += html_success % (best_k, max_genomic_kmers)
        image = prefix+".dat.png"
        image_pdf= prefix+".dat.pdf"
        if os.path.exists(image_pdf) and output_format == "pdf":
            # convert pdf to png using ghostscript
            run(["gs", "-dBATCH", "-dNOPAUSE", "-sDEVICE=pngalpha", "-sOutputFile=%s" % image, "-r144", image_pdf])
        if os.path.exists(image):
            html += insert_image(image) 
            html += html_footer_genomic_kmers
    else:
        html += html_failure

    html += html_individual_histograms
    png_sorted_by_k = sorted(png_files, key=lambda x: int(re.findall(r'\d+',x)[-1]))
    for image in png_sorted_by_k:
        html += insert_image(image)
    html += html_footer
    
    with open(output,'w') as f:
        f.write(html)

    if os.path.exists(prefix+".dat.png"):
        os.remove(prefix+".dat.png")
    for image in png_files:
        os.remove(image)
        

if __name__=='__main__':
    
    if len(sys.argv) <= 1:
        sys.exit(doc)

    args = sys.argv[1:] 
    prefix = args[0]
    output = None if "-o" not in args else args[args.index("-o")+1]
    is_diploid = "T" if "--diploid" in args else "F"

    generate_report(prefix, -1, -1, output, is_diploid)

